import React, { useState, useEffect } from 'react';
import ProviderRegistration from './components/ProviderRegistration';
import ProviderLogin from './components/ProviderLogin';
import PatientLogin from './components/PatientLogin';
import PatientRegistration from './components/PatientRegistration';
import Navigation from './components/Navigation';

function App() {
  const [currentView, setCurrentView] = useState<'provider-login' | 'provider-registration' | 'patient-login' | 'patient-registration'>('patient-registration');

  // Handle URL parameters on component mount
  useEffect(() => {
    const urlParams = new URLSearchParams(window.location.search);
    const viewParam = urlParams.get('view');

    if (viewParam === 'provider-registration') {
      setCurrentView('provider-registration');
    } else if (viewParam === 'provider-login') {
      setCurrentView('provider-login');
    } else if (viewParam === 'patient-login') {
      setCurrentView('patient-login');
    } else if (viewParam === 'patient-registration') {
      setCurrentView('patient-registration');
    }
  }, []);

  const handleViewChange = (view: 'provider-login' | 'provider-registration' | 'patient-login' | 'patient-registration') => {
    setCurrentView(view);
    // Update URL with new view
    const url = new URL(window.location.href);
    url.searchParams.set('view', view);
    window.history.pushState({}, '', url.toString());
  };

  const handleNavigateToLogin = () => {
    if (currentView === 'provider-registration') {
      handleViewChange('provider-login');
    } else if (currentView === 'patient-registration') {
      handleViewChange('patient-login');
    }
  };

  const handleNavigateToRegistration = () => {
    if (currentView === 'provider-login') {
      handleViewChange('provider-registration');
    } else if (currentView === 'patient-login') {
      handleViewChange('patient-registration');
    }
  };

  return (
    <div className="min-h-screen bg-medical-gray">
      <Navigation currentView={currentView} onViewChange={handleViewChange} />
      {currentView === 'provider-login' && <ProviderLogin onNavigateToRegistration={handleNavigateToRegistration} />}
      {currentView === 'provider-registration' && <ProviderRegistration onNavigateToLogin={handleNavigateToLogin} />}
      {currentView === 'patient-login' && <PatientLogin onNavigateToRegistration={handleNavigateToRegistration} />}
      {currentView === 'patient-registration' && <PatientRegistration onNavigateToLogin={handleNavigateToLogin} />}
    </div>
  );
}

export default App;
